CREATE PROC [dbo].[CreateApartment]
 @Guid uniqueidentifier,
 @Name nvarchar(100),
 @Price money,
 @CityId int,
 @Address nvarchar(100),
 @MaxAdults int,
 @MaxChildren int,
 @Status nvarchar(100),
 @TotalRooms int,
 @BeachDistance int,
 @OwnerId int

AS
BEGIN
	Insert Apartment ([Guid], CreatedAt, OwnerId, TypeId, StatusId, CityId, [Address], [Name], NameEng, Price, MaxAdults, MaxChildren, TotalRooms, BeachDistance)
	values(@Guid, GETDATE(), @OwnerId, 999, (select Id from ApartmentStatus where [NameEng] = @Status), @CityId, @Address,@Name,@Name,@Price,@MaxAdults,@MaxChildren,@TotalRooms,@BeachDistance)
	
	
END
GO
