GO
CREATE PROC [dbo].[LoadApartmantsByStatus]
@Status nvarchar(250)
AS
BEGIN
	SELECT A.*,C.Name as City,AO.Name as [Owner], [AS].NameEng as [Status] --A.Name, C.Name as City, A.Address, A.MaxAdults, A.MaxChildren, A.TotalRooms, A.Price, AO.Name as [Owner], [AS].Name as [Status],
	FROM Apartment AS A 
	Inner join City as C on C.Id = A.CityId
	Inner join ApartmentOwner as AO on AO.Id = A.OwnerId
	Inner join ApartmentStatus as [AS] on [AS].Id = A.StatusId
	where A.StatusId = (select Id from ApartmentStatus where [NameEng] = @Status)
END
GO
