CREATE PROC [dbo].[LoadTags]

AS
BEGIN
	SELECT t.Id, t.NameEng, tt.Id as TypeId, tt.NameEng as TypeName, Count( ta.ApartmentId) as ApartmentsUsing
	FROM Tag as t
	inner join TagType as tt on tt.Id = t.TypeId
