CREATE PROC [dbo].[UpdateApartment]
 @Id int,
 @Name nvarchar(100),
 @Price money,
 @CityId int,
 @Address nvarchar(100),
 @MaxAdults int,
 @MaxChildren int,
 @Status nvarchar(100),
 @TotalRooms int,
 @BeachDistance int
AS
BEGIN
	Update Apartment 
	set [Name] = @Name,
		Price = @Price,
		CityId=@CityId,
		[Address]=@Address,
		MaxAdults=@MaxAdults,
		MaxChildren=@MaxChildren,
		StatusId=(select Id from ApartmentStatus where NameEng = @Status),
		TotalRooms=@TotalRooms,
		BeachDistance=@BeachDistance
	where Id = @Id
	
END
